render() {
    return (
        <div>
             <h1>User Detail</h1>
              <SearchBar/> 
             <div className="container">
                <table className="table">
                    <thead>
                        <tr>
                            <th>FirstName</th>
                            <th>LastName</th>
                            <th>Balance</th>                   
                        </tr>
                    </thead>
                    <tbody>
                    {
                        this.state.users.map (
                            user =>
                                <tr key={user.userId.toString()}>
                                    <td>{user.firsName.toString()}</td>
                                    {/* <td>{user.lastName}</td>
                                    <td>{user.balance}</td> */}
                                </tr>
                        )
                        }
                    </tbody>
                </table>
             </div>
        </div>
    )
  }
}

export default UserComponent
